import React from "react";
import { Nav, Text } from "./navigation.styles";
const Navigation = () => {
  return (
    <Nav>
      <Text>Sign Out</Text>
    </Nav>
  );
};
User.defaultProps = {
  name: "Alena Sanders",
  username: "@alenasanders",
  imageURL: "https://randomuser.me/api/portraits/women/57.jpg",
};
export default Navigation;
